$(document).on('click', '#btnPrint', function (event) {
    //event.preventDefault();

    $.ajaxSetup({
        headers: {
            'X-CSRF-TOKEN': jQuery('meta[name="csrf-token"]').attr('content')
        }
    });

    var image = 'data:image/png;base64,';
    //var imagen ='data:image/png;base64,'+btoa('fge.png');
    var payment_id = $('#payment_id').val();
    $.ajax({
        url: window.location.origin+'/payments/printPDF',
        type: 'POST',
        data: { payment_id },
        dataType: 'json',
        success: function (response) {
            var payment = response.payment;
            var student = response.student;
            var group = response.group;
            var course = response.course;
            var concept = response.concept;
            
            var doc = new jsPDF.jsPDF('p','mm','a5');

            doc.addImage(image,'PNG',15,15,24,17);

            doc.setFont('times','bold');
            doc.setFontSize(12);
            doc.text('Receipt #'+payment.folionumber,60,20);
            doc.setFontSize(10);
            doc.text('Tel: 747 108 2254     Tel: 747 133 7292',50,30);
            doc.text('Tel: 747 142 4345     Tel: 747 122 0095',50,35);

            var label = {fillColor: [39, 61, 114], textColor: [255, 255, 255], fontStyle: 'bold'}
            var label_lg = {fillColor: [39, 61, 114], textColor: [255, 255, 255],  fontStyle: 'bold', halign: 'center',valign:'middle'}

            doc.autoTable({
                theme: 'grid',
                startY:60,
                styles: {font: 'times',fontSize: 10,  fontStyle: 'bold'},
                body: [
                    [{ content: 'Folio number', styles: label}, payment.folionumber,
                        { content: 'Date', styles: label}, payment.created_at],
                    [{content: 'Enrollment', styles: label, colSpan: 2},
                        {content: student.enrollment, colSpan: 2}],
                    [{content: 'Student', styles: label, colSpan: 2},
                        {content: student.name+' '+student.lastname, colSpan: 2}],
                    [{content: 'Group', styles: label, colSpan: 2},
                        {content: group.days+'@'+group.starthour+'-'+group.finalhour, colSpan: 2}],
                    [{content: 'Course', styles: label, colSpan: 2},
                        {content: course.course, colSpan: 2}],
                    [{content: 'Payment information', styles: label_lg,colSpan: 4}],
                    [{content: 'Concept', styles: label, colSpan: 2},
                        {content: concept.concept, colSpan: 2}],
                    [{content: 'Amount', styles: label, colSpan: 2},
                        {content: '$'+parseFloat(payment.amount), colSpan: 2}],
                    [{content: 'Surcharge', styles: label, colSpan: 2},
                        {content: '$'+parseFloat(payment.surcharge), colSpan: 2}],
                    [{content: 'Total', styles: label_lg, colSpan:4}],
                    [{content: '$'+(parseFloat(payment.amount)+parseFloat(payment.surcharge)), styles: {halign: 'center', fontSize: 12}, colSpan:4}],
                ],
            });
            
            doc.save('R_'+payment.folionumber+'.pdf');
            
        },
        error: function (response) {
            console.log(response);
        }
    });

});